<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelEditOperators/SekcijaSajjtovOperatora&amp;amp;v=41w" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Операторы&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Edit&amp;nbsp;Operators&amp;nbsp;/&amp;nbsp;Секция&amp;nbsp;Сайтов&amp;nbsp;Оператора&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelEditOperators/SekcijaSajjtovOperatora&amp;amp;time=2009-03-20+11%3A35%3A08">2009-03-20 11:35:08&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelEditOperators/SekcijaSajjtovOperatora&amp;amp;time=2009-03-20+11%3A38%3A50">2009-03-20 11:38:50&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">Кроме созданных вручную тарифных планов (в форме &amp;#147;Edit tariffs&amp;#148;), на&amp;nbsp;оригинацию можно использовать служебную функцию «Себестоимость», это&amp;nbsp;позволит звонить с&amp;nbsp;этого сайта по&amp;nbsp;всем доступным направлениям по&amp;nbsp;себестоимости этих направлений. При&amp;nbsp;использовании себестоимости нельзя выставить инвойс, поскольку отсутствует реальный тарифный план, поэтому не&amp;nbsp;рекоммендуется использовать эту&amp;nbsp;функцию для&amp;nbsp;клиентов. &lt;br />
При&amp;nbsp;создании сайта, за&amp;nbsp;ним не&amp;nbsp;закреплены никакие тарифные планы. Без&amp;nbsp;тарифного плана через сайт звонки проходить не&amp;nbsp;будут,нужно закрепить тарифный план и&amp;nbsp;включить сервис (Enable service).&lt;/div>&lt;br />
&lt;b>Удалено:&lt;/b>&lt;br />
&lt;div class="deletions">Кроме созданных вручную тарифных планов (в форме &amp;#147;Edit tariffs&amp;#148;), к&amp;nbsp;сайту оператора можно прикрепить оригинационный план «Себестоимость», это&amp;nbsp;позволит оператору звонить по&amp;nbsp;всем доступным направлениям по&amp;nbsp;себестоимости этих направлений. При&amp;nbsp;использовании себестоимости нельзя выставить инвойс, поскольку отсутствует реальный тарифный план.&lt;br />
При&amp;nbsp;создании сайта, за&amp;nbsp;ним не&amp;nbsp;закреплены никакие тарифные планы. Без&amp;nbsp;тарифного плана через этот сайт звонки проходить не&amp;nbsp;будут.&lt;/div>&lt;/div>
</description>
</item>
