&lt;div class="deletions">Кроме созданных вручную тарифных планов (в форме &amp;#147;Edit tariffs&amp;#148;), к&amp;nbsp;сайту оператора можно прикрепить оригинационный план «Себестоимость», это&amp;nbsp;позволит оператору звонить по&amp;nbsp;всем доступным направлениям по&amp;nbsp;себестоимости этих направлений. При&amp;nbsp;создании сайта, за&amp;nbsp;ним не&amp;nbsp;закреплены никакие тарифные планы. Без&amp;nbsp;тарифного плана через этот сайт звонки проходить сайт не&amp;nbsp;будут.&lt;br />
||**Замечание:**|При наличии у&amp;nbsp;оператора нескольких сайтов, система будет обрабатывать их&amp;nbsp;в порядке, обратном порядку их&amp;nbsp;добавления в&amp;nbsp;систему, в&amp;nbsp;первую очередь будут рассматриваться сайты добавленные в&amp;nbsp;последнюю очередь.||&lt;/div>&lt;/div>
</description>
